function LoadLangV(lang) {
	if (document.getElementById("RADEDITORSTYLESHEET0")) {
		return;
	}

	var scr = document.createElement('script');
	scr.setAttribute('src', '/BcJsLang/ValidationFunctions.aspx?lang=' + lang);
