// consistent with General->Check_URLChar()
function checkUrlChar(strng, FieldName) {
	var error = "";
	for (i = 0; i < strng.length; i++) {
		var c = strng.charAt(i);
		switch (c) {
			case "/":
			case "\\":
			case "#":
			case "?":
			case ":":
			case "@":
			case "=":
			case "&":
			case '"':
			case "|":
			case "_":
			case ".":
			case "%":
				error = "- " + FieldName + validatelang.Others.CannotContain + "[" + c + "] " + validatelang.Others.Character;
				return error;
		}
	}
	return error;
}

